    let slug = useParams().slug;
    const {rooms} = useContext(RoomContext)
    console.log(useParams().slug)
    let SingleRoom = rooms.find((rooms => rooms.slug === slug))
    return (
        <div>
            {SingleRoom}
        </div>
    )
}
